import React from "react";

import "./inputform.scss";
import { FormInputContainer, GroupContainer } from "./inputform.styles";

const InputForm = ({ onChangeHandle, label, ...otherProps }) => (
  <GroupContainer>
    <FormInputContainer onChange={onChangeHandle} {...otherProps} />
    {label ? <FormInputLabel>{label}</FormInputLabel> : null}
  </GroupContainer>
);
export default InputForm;
